import Liste from "./comp2/Liste";
import Tablo from "./comp2/tablo";
import Tablo2 from "./comp2/tablo2";
import Kisi from "./comp3/Kisi";
import Aders from "./components/Aders";
import Bders from "./components/Bders";
import Cders from "./components/Cders";
import students from "./assets/data/student.json";

function App() {
  return (
    <div className="App">
      {/*   <Aders />
      <Bders />
      <Cders />
        <Tablo />
      <Liste />
      */}
      {students.map((student, index) => {
        return (
          <Kisi
            key={index}
            ad={student.isim}
            img={student.img}
            yas={student.yas}
            kurs={student.kurs}
          />
        );
      })}
    </div>
  );
}
export default App;
